import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

import axios from "axios";
import './ManagerPortal.css';

const ManagerPortal = () => {

    const [data, setData] = useState();

    useEffect(async() => {
      const res = await axios.get("http://127.0.0.1:8000/api/orders");
      console.log("DATA IS::",res.data.orders);
      if(res) setData(res.data.orders);
    }, [])

    const dataHtml = data.map((item, index) => {
      return (
        <tr key={item.id}>
          <td>{item.id}</td>
          <td>{item.service}</td>
          <td>{item.type}</td>
          <td>{item.status}</td>
        </tr>
      );
    });

    return (
      <React.Fragment>
      <div class="manager_portal">
        <h1>Welcome to the Manager Portal</h1>

        <div class="links">
          <div class="link">
          <Link to="/EmpRegistration">Register Employee</Link>
          </div>
          <div class="link">
          <Link to="/ServiceRegistration">Register Service</Link>
          </div>
          <div class="link">
          <Link to="/EquipRegistration">Register Equipment</Link>
          </div>
        </div>
      </div>

      <div class="equipments">
          <div class="heading">
            <h1>Daily Tasks:</h1>
          </div>
          <div class="table">
            <table>
              <thead>
                  <th key="id">Order Id</th>
                  <th key="service" filterkey="service">
                    Service
                  </th>
                  <th key="type" filterkey="service">
                    Delivery Type
                  </th>
                  <th key="status" filterkey="status">
                    Status
                  </th>
              </thead>
              <tbody>{dataHtml}</tbody>
            </table>
          </div>
        </div>
      </React.Fragment>
    );
  }

  export default ManagerPortal;
